package org.springframework.samples.petclinic.owner;

import static org.assertj.core.api.Assertions.assertThat;
import static org.assertj.core.api.Assertions.assertThatThrownBy;
import static org.junit.jupiter.api.Assertions.assertThrows;
import static org.mockito.Mockito.when;

import java.text.ParseException;
import java.util.List;
import java.util.Locale;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;

@ExtendWith(MockitoExtension.class)
class PetTypeFormatterTest {

	@Mock
	private PetTypeRepository types;

	private PetTypeFormatter formatter;

	@BeforeEach
	void setUp() {
		formatter = new PetTypeFormatter(types);
	}

	@Test
	@DisplayName("print should return the name of the PetType for valid input")
	void print_validPetType_returnsName() {
		// Arrange
		PetType petType = new PetType();
		petType.setName("Dog");
		Locale locale = Locale.ENGLISH;

		// Act
		String result = formatter.print(petType, locale);

		// Assert
		assertThat(result).isEqualTo("Dog");
	}

	@Test
	@DisplayName("print should throw exception for null PetType")
	void print_nullPetType_throwsException() {
		// Arrange
		PetType petType = null;
		Locale locale = Locale.ENGLISH;

		// Act & Assert
		assertThatThrownBy(() -> formatter.print(petType, locale)).isInstanceOf(NullPointerException.class);
	}

	@Test
	@DisplayName("parse should return PetType for matching name")
	void parse_matchingName_returnsPetType() throws ParseException {
		// Arrange
		PetType dog = new PetType();
		dog.setName("Dog");
		PetType cat = new PetType();
		cat.setName("Cat");
		when(types.findPetTypes()).thenReturn(List.of(dog, cat));
		String text = "Dog";
		Locale locale = Locale.ENGLISH;

		// Act
		PetType result = formatter.parse(text, locale);

		// Assert
		assertThat(result).isEqualTo(dog);
	}

	@Test
	@DisplayName("parse should throw ParseException for non-matching name")
	void parse_nonMatchingName_throwsParseException() {
		// Arrange
		PetType dog = new PetType();
		dog.setName("Dog");
		when(types.findPetTypes()).thenReturn(List.of(dog));
		String text = "Cat";
		Locale locale = Locale.ENGLISH;

		// Act & Assert
		assertThrows(ParseException.class, () -> formatter.parse(text, locale));
	}

}
